import React from 'react';
import { Children } from 'react';
import { Link } from 'react-router-dom';
import logo from '../images/Logo.svg'

export default function Header({ onClick, headerText, children, loggedIn, link }) {
  return (
    <header className="header">
      <img
      src={logo}
      alt="логотип Mesto"
      className="header__logo"
    />
      <div className="header__container">
          <p className="header__user-email">{children}</p>
          <Link to={link}
            onClick={onClick}
            className={`${loggedIn && 'header__link_goout'} header__link`}>{headerText}
          </Link>
        </div>
    </header>
  )
}
